Proteus 2 использует новые технологии, которые мы развиваем, которая добавляет различные зоны и районы в мир.

Мы удвоили количество мировых текстур, оказанные миллионам лезвий травы, и населены бесчисленные новые инопланетные фолиги - каждый уступающий различные ресурсы.
;

Теперь, что вы наблюдаете в своих приключениях, теперь можно обнаружить. Намного больше, чем простое достижение, система обнаружения фактически разблокирует все различные ресурсы, которые принесет любой найденный ресурс.

По сути, каждое оружие или инструмент, используемый на ресурсе, может привести к различному элементу, что позволяет значительно более научно исследовать солнечную систему и всех его жизненных форм.
;

Минералы теперь могут быть отфильтрованы на вашем обновленном GPS. Этот очень удобный инструмент, который теперь всегда доступен в вашем HUD и больше не прикреплен к вашему локатору, читает из ваших окружающих спутников и собственным внутренним костюмом радара для создания радиусов обнаружения.

Эта система покажет вам все окружающие минералы, их твердость и плотность, поэтому вы можете найти то, что вы ищете в своих миссиях по крафтации.
;

1-1. Физическая среда играет решающую роль в выживании. Температура, погодные системы, местность и жизненные формы коренных народов имеют прямое влияние на здоровье и устойчивость. Осознавая эти элементы и эффект, который у них имеет первостепенное значение.

1-2. Превентивные меры, раннее признание и быстрый лечение помогают минимизировать вероятность снижения функциональности и возможной смерти. Короче говоря, осведомленность является ключом.
;

1-5. Ландшафт на дополнительных солнечных планетах может быть ошеломленными и должен проходить с осторожностью. Любой ошибок может привести к повреждению вашего костюма ЕВА и привести к нарушению костюма, который может быть катастрофическим. Он немало бы исследовать с особой осторожностью.

1-6. Склон. При попытке подняться на наклон Обязательно посмотрите на индикатор предупреждения на склоне. Для склонов, которые превышают на 30 градусов, либо на склоне или снижении, представляют опасность для вашего обхода. Попытка прыгать или бегать на этой неровной местности не рекомендуется.

При необходимости приседает приседание для прохождения крайних склонов.;

3-1 Качество жизни в значительной степени зависит от питания, гидратации и общего здоровья. Со временем физическое состояние может ухудшаться, влиять на скорость и выживание. Голод и жажда, если не устранены, может вызвать снижение здоровья и производительности. Климатические условия, такие как тепло и холод, также имеют эффект. Необходимо следить за этим, используя соответствующие показания.

3-2. Когда физическое состояние уменьшается и ухудшается здоровье, исцеление возможно, используя определенные виды пищи и повязки. Исцеление имеет решающее значение для того, чтобы поддерживать жизнь.
;

7-5. U.n.e. Оперативники могут оказаться в контакте с другим персоналом. В этих ситуациях этот персонал может сгруппировать либо настраивая вечеринку или колонию.

7-6. Настройка вечеринки: для персонала, создавая вечеринку, им нужно идти по другому оперативному, посмотрите на них, а затем нажмите [F], чтобы пригласить. Персонал, присоединяясь к вечеринке, должен посмотреть и пригласитель, а затем нажмите [Принять] в меню.
;

